---
avi_config:
  vsvip:
    - name: "vsvip_app1"
      cloud_ref: '/api/cloud?name=Default-Cloud'
      dns_info:
        - num_records_in_response: 1
          type: DNS_RECORD_A
          fqdn: "1.homelab.local"
          algorithm: DNS_RECORD_RESPONSE_CONSISTENT_HASH
          ttl: 30
      vip:
      - auto_allocate_ip: true
        vip_id: 1
        avi_allocated_fip: false
        discovered_networks:
        - subnet:
            - mask: 24
              ip_addr:
                type: V4
                addr: "192.168.0.0"
          network_ref: "/api/network?name=Management"
        enabled: true
        ipam_network_subnet:
          subnet:
            mask: 24
            ip_addr:
              type: V4
              addr: 192.168.0.0
          network_ref: "/api/network?name=Management"
        auto_allocate_floating_ip: true
        avi_allocated_vip: false
